<!DOCTYPE html>
<html lang="pt-BR">
<head>
<meta charset="UTF-8">
<title>Restaurantes</title>

<style>
    body {
        background-color: #1f3a33;
        font-family: Arial, sans-serif;
        margin: 0;
        padding: 20px;
        color: #fff;
    }

    .container {
        max-width: 900px;
        margin: auto;
        text-align: center;
        padding: 20px;
        background-color: #22463c;
        border-radius: 12px;
        border: 2px solid #355a50;
    }

    .title-box {
        background: #ffffff;
        padding: 10px 0;
        border-radius: 10px;
        margin-bottom: 30px;
        font-size: 24px;
        color: #000;
        font-weight: bold;
    }

    .logos {
        display: grid;
        grid-template-columns: repeat(5, 1fr);
        gap: 25px;
        justify-items: center;
    }

    .logos a {
        text-decoration: none;
    }

    .logos img {
        width: 110px;
        height: 110px;
        object-fit: cover;
        border-radius: 50%;
        background: #fff;
        padding: 6px;
        transition: 0.2s;
    }

    .logos img:hover {
        transform: scale(1.07);
    }
</style>
</head>
